<li>npm i multer
<ul>
<li>Multer 是一个node.js中间件，用于处理 multipart/form-data类型的表单数据，主要用于上传文件。</li>
<li>在form表单上要加上 enctype=“multipart/form-data” 的属性。</li>
<li>Multer 不会处理任何非 multipart/form-data 类型的表单数据。</li>
<li>不要将 Multer 作为全局中间件使用，因为恶意用户可以上传文件到一个你没有预料到的路由，应该只在你需要处理上传文件的路由上使用。</li>
</ul>
</li>
